import { useState } from "react";
import '../style/register';

function Register () {
  const [credentials, setCredentials] = useState({
    name: '',
    email: '',
    password: '',
    passwordConfirmation: '',
  });

  const onTyping = ({ target: { name, value } }) => {
    setCredentials({ ...credentials, [name]: value });
  }

  return (
    <div className="container">
      <form className="container-login">
        <label htmlFor="name" className="container-input-login">
          Nome Completo
          <input
            className="input-login"
            type="text"
            placeholder="Insira seu nome"
            id="name"
            name="name"
            value={ credentials.name }
            onChange = { onTyping }
          />
        </label>
        <label htmlFor="email" className="container-input-login">
          E-mail
          <input
            className="input-login"
            type="email"
            placeholder="Insira seu e-mail"
            id="email"
            name="email"
            value = { credentials.email }
            onChange = { onTyping }
          />
        </label>
        <label htmlFor="password" className="container-input-login">
          Senha
          <input
            className="input-login"
            type="password"
            placeholder="Insira sua senha"
            id="password"
            name="password"
            value = { credentials.password }
            onChange = { onTyping }
          />
        </label>
        <label htmlFor="password-confirmation" className="container-input-login">
          Confirmação de senha
          <input
            className="input-login"
            type="password  "
            placeholder="Confirme sua senha"
            id="password-confirmation"
            name="passwordConfirmation"
            value = { credentials.passwordConfirmation }
            onChange = { onTyping }
          />
        </label>
      </form>
    </div>
  )
};

export default Register;
